e(&#x27;text&#x27;).then(text =&gt; {\n    cy.log(`Row ${index + 1}: ${text}`);\n  });\n});&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;30eda7d6-0814-4235-91a3-d94149aad1ee&quot;,&quot;parentUUID&quot;:&quot;912f46ce-97b4-4d14-a60e-d7f5b330d89f&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;Get the last row and sum the text, and the sum text will be equal to total amount&quot;,&quot;fullTitle&quot;:&quot;exercise Get the last row and sum the text, and the sum text will be equal to total amount&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:1826,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:null,&quot;code&quot;:&quot;let sum = 0;\nlet totalAmount = 0;\n// Get the total amount from the .totalAmount element\ncy.get(&#x27;.totalAmount&#x27;).invoke(&#x27;text&#x27;).then(text =&gt; {\n  // Extract the number from the text\n  totalAmount = parseInt(text.trim().replace(&#x27;Total Amount Collected:&#x27;, &#x27;&#x27;).trim(), 10);\n});\n// Get all the rows inside the scrollable table and sum the last column\ncy.get(&#x27;.tableFixHead &gt; table &gt; tbody &gt; tr &gt; td:last-child&#x27;).then($cells =&gt; {\n  const values = [];\n  $cells.each((index, cell) =&gt; {\n    // Get the text content of the cell\n    const text = Cypress.$(cell).text().trim();\n    values.push(text);\n  });\n  // Convert the text values to integers and sum them\n  values.forEach(text =&gt; {\n    const value = parseInt(text, 10);\n    if (!isNaN(value)) {\n      sum += value;\n    }\n  });\n  // Log the sum of the last column\n  cy.log(`Sum of the last column: ${sum}`);\n  // Assert the sum is equal to the total amount\n  expect(sum).to.equal(totalAmount);\n});&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;abf2f386-a46c-46e5-a3c1-e7c7aacde35d&quot;,&quot;parentUUID&quot;:&quot;912f46ce-97b4-4d14-a60e-d7f5b330d89f&quot;,&quot;isHo
